-- ----------------------------
-- Table structure for xn_apply
-- ----------------------------
DROP TABLE IF EXISTS `xn_apply`;
CREATE TABLE `xn_apply` (
`apply_id`  int(11) NOT NULL AUTO_INCREMENT ,
`stu_name`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '学生姓名' ,
`admin_id`  varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL ,
`stu_sn`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '学生编号' ,
`register`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '户籍' ,
`area`  int(2) NOT NULL COMMENT '户籍所在区域' ,
`sex`  tinyint(1) NOT NULL DEFAULT 2 COMMENT '1 男 0女 2未知' ,
`class`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '班级' ,
`graduated_school`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '毕业学校' ,
`family_info`  text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '家庭成员信息' ,
`grade_info`  text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '文化素质' ,
`apply_condition`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '申请条件 0|0|0 都没选 1表示选中' ,
`honor`  text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '荣誉' ,
`point`  text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '特长' ,
`created_at`  timestamp NULL DEFAULT NULL ,
`updated_at`  timestamp NULL DEFAULT NULL ,
`deleted_at`  timestamp NULL DEFAULT NULL ,
`apply_res`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '报名结果' ,
`face_time`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '面试时间' ,
`print_res`  tinyint(1) NULL DEFAULT 0 COMMENT '是否打印 1表示打印过' ,
`admission_res`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '面试结果' ,
PRIMARY KEY (`apply_id`),
UNIQUE INDEX `stu_sn` USING BTREE (`stu_sn`) 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
AUTO_INCREMENT=9

;

